import { Button } from '@material-ui/core'
import React from 'react'
import { Data } from './Data'
import { Container, Wrapper } from './style'
function Card() {
    return (
        <Container>
            {Data.map((data) => (
                <Wrapper
                    style={{
                        backgroundImage: `url('${data.imgUrl})'`,
                        backgroundSize: 'cover',
                    }}
                >
                    <h1>{data.title}</h1>
                    <Button>Shop Now</Button>
                </Wrapper>
            ))}
        </Container>
    )
}

export default Card
